function populateSelect(id, values) {
  const sel = document.getElementById(id);
  sel.innerHTML = '';
  values.forEach(v => {
    const opt = document.createElement('option');
    opt.value = v;
    opt.textContent = v;
    sel.appendChild(opt);
  });
}

populateSelect('company', companies);
populateSelect('location', locations);
populateSelect('month', months);
populateSelect('skill', skills);

function getSelections(id) {
  const sel = document.getElementById(id);
  return Array.from(sel.selectedOptions).map(o => o.value);
}

function applyFilters() {
  const c = new Set(getSelections('company'));
  const l = new Set(getSelections('location'));
  const m = new Set(getSelections('month'));
  const s = new Set(getSelections('skill'));

  const idx = [];
  for (let i = 0; i < DATA.id.length; i++) {
    const okC = c.size === 0 || c.has(DATA.company[i]);
    const okL = l.size === 0 || l.has(DATA.loc[i]);
    const okM = m.size === 0 || m.has(DATA.ym[i]);
    let okS = true;
    if (s.size > 0) {
      okS = DATA.skills[i].some(x => s.has(x));
    }
    if (okC && okL && okM && okS) idx.push(i);
  }
  return idx;
}

function groupCount(indices, accessor) {
  const counts = new Map();
  indices.forEach(i => {
    const key = accessor(i);
    counts.set(key, (counts.get(key) || 0) + 1);
  });
  const arr = Array.from(counts.entries()).map(d => ({key: d[0], val: d[1]}));
  arr.sort((a,b) => b.val - a.val);
  return arr;
}

function updateKPIs(indices) {
  document.getElementById('kpi_total').textContent = indices.length.toString();
  const compSet = new Set();
  const locSet = new Set();
  const monSet = new Set();
  indices.forEach(i => { compSet.add(DATA.company[i]); locSet.add(DATA.loc[i]); monSet.add(DATA.ym[i]); });
  document.getElementById('kpi_companies').textContent = compSet.size.toString();
  document.getElementById('kpi_locations').textContent = locSet.size.toString();
  document.getElementById('kpi_months').textContent = monSet.size.toString();
}

function drawAll() {
  const idx = applyFilters();
  updateKPIs(idx);

  // Time series
  const ts = groupCount(idx, i => DATA.ym[i]).reverse();
  Plotly.react('ts', [{
    x: ts.map(d => d.key), y: ts.map(d => d.val), type: 'scatter', mode: 'lines+markers', line: {color: '#F58518'}
  }], {title: 'Postings Over Time', margin: {t: 40}});

  // Companies
  const gcC = groupCount(idx, i => DATA.company[i]).slice(0, 20);
  Plotly.react('companies', [{
    x: gcC.map(d => d.val), y: gcC.map(d => d.key), type: 'bar', orientation: 'h', marker: {color: '#4C78A8'}
  }], {title: 'Top Companies', margin: {t: 40}});

  // Locations
  const gcL = groupCount(idx, i => DATA.loc[i]).slice(0, 20);
  Plotly.react('locations', [{
    x: gcL.map(d => d.val), y: gcL.map(d => d.key), type: 'bar', orientation: 'h', marker: {color: '#72B7B2'}
  }], {title: 'Top Locations', margin: {t: 40}});

  // Skills (computed from selected records)
  const counts = new Map();
  idx.forEach(i => { (DATA.skills[i] || []).forEach(s => { counts.set(s, (counts.get(s)||0)+1); }); });
  const arr = Array.from(counts.entries()).map(d => ({key: d[0], val: d[1]}));
  arr.sort((a,b) => b.val - a.val);
  const topS = arr.slice(0, 20);
  Plotly.react('skills', [{
    x: topS.map(d => d.val), y: topS.map(d => d.key), type: 'bar', orientation: 'h', marker: {color: '#54A24B'}
  }], {title: 'Top Skills', margin: {t: 40}});
}

document.getElementById('company').addEventListener('change', drawAll);
document.getElementById('location').addEventListener('change', drawAll);
document.getElementById('month').addEventListener('change', drawAll);
document.getElementById('skill').addEventListener('change', drawAll);

// Initial draw
drawAll();
